import React from 'react';
import './TopBar.css';
import FacebookIcon from '@mui/icons-material/Facebook';

function TopBar() {
  return (
      <>
    <div className='top'>
        <div className='topLeft'>FacebookIcon</div>
        <div className='topCenter'>c</div>
        <div className='topRight'>r</div>
    </div>
    </>
  )
}

export default TopBar
